Serial-MIDI converter connects your computer's serial port to MIDI software and hardware. It allows you to have your Arduino send MIDI messages to Apple's GarageBand.

<li >
<p >Download Spikenzielab.com's Serial-MIDI converter  and unzip it </p>
</li>
<li >
<p >Download and install themidibus library in the documents:processing:libraries folder (<a rel="nofollow" href="http://smallbutdigital.com/themidibus.php" >http://smallbutdigital.com/themidibus.php</a>)</p>
</li>
<li >
<p >Open Apple's Audio MIDI Setup </p>
</li>
<li >
<p >Select Window&gt;Show MIDI Window </p>
</li>
<li >
<p >Double click on the IAC Driver</p>
</li>
<li >
<p >Enable Device is Online</p>
</li>
<li >
<p >You can close Audio MIDI Setup </p>
</li>
<li >Open Arduino 1.0 or greater.</li>

