// DESCRIPTION:<br />
// Demo sketch to play notes from middle C in the 4th octave up to B in the 5th octave and then back down.<br />
//<br />
//<br />
// HOOK-UP:<br />
// 1. Plug USB cable from Arduino into your computer.<br />
//<br />
