int note = 0;     
void setup()<br />
{<br />
Serial.begin(57600);                                       // Default speed of the Serial to MIDI Converter serial port<br />
}
void loop() {
for(int note=60; note&lt;=83; note++)                        // Going Up<br />
{<br />
MIDI_TX(144,note,127);                                  // NOTE ON<br />
delay(100);
<code >MIDI_TX(128,note,127);                                  // NOTE OFF
delay(100);</code>
}
for(int note=82; note&gt;=61; note--)                       // Coming Down<br />
{<br />
MIDI_TX(144,note,127);                                  // NOTE ON<br />
delay(250);
<code >MIDI_TX(128,note,127);                                  // NOTE OFF
delay(250);</code>
}
}
void MIDI_TX(unsigned char MESSAGE, unsigned char PITCH, unsigned char VELOCITY) {<br />
Serial.write(MESSAGE);<br />
Serial.write(PITCH);<br />
Serial.write(VELOCITY);<br />
}

<li >
<p >Launch SM by navigating to application.macosx&gt;source&gt;Serial_MIDI_Converter_V2D.pde When you open it, you will be prompted to create a folder. Do that. Then run the sketch </p>
</li>
<li >Choose the serial port that the Arduino is using. Mine was A</li>

This is the serial port that will be used for both serial TX and RX. Your micro-controllers serial port must be set to 57600 bps 8N1. (Even though MIDI is transmitted at 31250 bps, the serial port is set at a faster baud rate to help minimize any lag time.)  

<li >
<p >Select 57600. This was E</p>
</li>
<li >
<p >Choose a MIDI-in port.<br />
This is the source of MIDI data that will be sent out of the serial port. This can be a little confusing, if you are using audio software this will be the MIDI-out of the software ! If you are using an external controller like a keyboard, this will be the MIDI-in port from that device.  This was A</p>
</li>
<li >
<p >Choose a MIDI-out port.<br />
When the SM receives serial data it will pass the data out of this MIDI port. You will most often choose the port that your audio software uses as input, but you could also choose another MIDI device. Also A</p>
</li>
<li >The SM must be running to direct MIDI to and from serial ports. So, just let it run in the background. </li>

15.Open GarageBand

<li >
<p >Select Piano</p>
</li>
<li >Navigate to Preferences and open MIDI/Audio.<br />
Select System Setting</li>

18.Edit Piano and select Digital Basic

<li >
<p >This time close and reopen GarageBand. Next time you won't need to set the Preferences.</p>
</li>
<li >Listen to your Arduino make music!</li>

